    //**************************************************************************
    float blabo( float  x[] )
     { /*   7-FEB 2008; K.F.JOHNSON: re-cast as a root callable subroutine; 
       Computes the inferred discriminant, as contained in the header file.    
       Arguments: the input variables used for the training, *in order*.
       Returns: float of value of inferred function for the given set of inputs.
      
       7-MAY-2009; Headerfile and variable list integrated; Provenance info
       supplied.      
    */
    
       float f,g, hsum;
       int i,j,k;
       float z[NNETS];
       
       float f1=0.0;
       for(i=0;i<NNETS;i++)
         {
           g=0.0;
           hsum = 0.0;
           for(j=0;j<NNODES;j++)   // w[net number][input][node]   
    	 { g=0.0;
         	   for(k=0;k<NINPUTS;k++){ g = g + w[i * NNODES*NINPUTS +k*NNODES  +j] * x[k];}
               g = hb[i*NNODES + j] + g; 
    	   g = (float)tanh(g);      //TRANSFER FUNCTION tanh
               hsum = hsum + hlo[i*NNODES + j] * g  ;
    	 }
           hsum = hsum + outb[i]; 
           f = 1.0/(1 + exp(-1.0 * hsum ));
           z[i]=f; 
         }//end loop over nets
    
       for(i=0;i<NNETS;i++) f1=f1+z[i]; 
       f1=f1/NNETS;
       return f1;
     } //end of blabo.c
    
    
